// src/components/App.jsx
import React, { useState } from 'react';
import ColumnaIzquierda from './ColumnaIzquierda';
import ColumnaDerecha from './ColumnaDerecha';
import './App.css';

const App = ({ token, urn }) => {
    const [isCollapsed, setIsCollapsed] = useState(false);

    const handleCollapse = () => {
        setIsCollapsed(!isCollapsed);
    };

    return (
        <div className="container-fluid">
            <div className="row">
                <ColumnaIzquierda isCollapsed={isCollapsed} handleCollapse={handleCollapse} />
                <ColumnaDerecha isCollapsed={isCollapsed} token={token} urn={urn} />
            </div>
        </div>
    );
};

export default App;
